import React,{useCallback} from 'react';
import Particles from '@tsparticles/react';
import { loadAll } from '@tsparticles/all';
import './App.css';
function Aa(){
    const aainit=useCallback(async(engine   )=>{
        console.log(engine); 
        await loadAll(engine);
    },[])
    return(
        <Particles
      className="cc"
      init={aainit}
      options={{
        background: {
          color: { value: "#ffffff" },  
        },
        particles: {
          number: { value: 80 },
          size: { value: 3 },
          color: { value: "#000000" },
          links: {
            enable: true,
            color: "#000000",
            distance: 150,
            opacity: 0.5,
            width: 1,
          },
          move: { enable: true, speed: 2},
        }
      }}
    />
    )
}
export default Aa;
